import React from "react";
import RouterComponent from "./Route";
import { DashboardWrapper } from "./modules/Dashboard";
import { AuthWrapper } from "./components";

const App = () => {
  return (
    <DashboardWrapper>
      <AuthWrapper>
        <RouterComponent />
      </AuthWrapper>
    </DashboardWrapper>
  );
};

export default App;
